INSERT INTO `practice` VALUES (3, 'aaa', '2021/04/03/215507368_3.jpg', '2021-04-01 02:00:00', '2021-04-30 00:00:00', 'bb', 'cc', 'a,b,c,d', '<p>阿斯顿发发<img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>', '清明期间，全国少工委动员广大少先队员到全国烈士纪念设施开展清明祭英烈活动，进行具体、生动、有温度的党史学习教育。教育引导广大少先队员，永远铭记英雄烈士的牺牲和奉献，传承和弘扬英雄烈士精神，激发爱党爱国情感、振奋民族精神，共同营造崇尚、学习，捍卫英雄烈士的浓厚氛围，在仪式熏陶、沉浸式情景、实践活动中，不断增强少先队党史学习教育的有效性、感染力。', '发布', '2021-04-03 21:55:17', '2021-04-03 22:05:12');

